Jz("common/result.effekt",'module result\n\nimport effekt\nimport option\nimport exception\n\n/// Represents the result of a potentially failing computation.\n/// It is the "reification" of the Exception[E] effect.\ntype Result[A, E] {\n  Error(exception: E, msg: String);\n  Success(a: A)\n}\n\n/// Represent ("reify") the result of a potentially failing computation.\ndef result[A, E] { f: \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\ndef result[A, E](proxy: on[E]) { f: \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\n\n/// Extracts the value of a result, if available\n/// Monadic "reflection"\ndef value[A, E](r: Result[A, E]): A / Exception[E] \x3d r match {\n  case Success(a) \x3d\x3e a\n  case Error(exc, msg) \x3d\x3e do raise(exc, msg)\n}\n\n/// Converts a result to an option forgetting the error details\ndef toOption[A, E](r: Result[A, E]): Option[A] \x3d r match {\n  case Success(a) \x3d\x3e Some(a)\n  case Error(exc, msg) \x3d\x3e None()\n}\n\ndef isError[A, E](r: Result[A, E]): Bool \x3d\n  if (r is Error(_, _)) true else false\n\ndef isSuccess[A, E](r: Result[A, E]): Bool \x3d\n  if (r is Success(_)) true else false');
Jz("common/string.effekt",'module string\n\nimport effekt\nimport option\nimport stream\nimport list\nimport exception\nimport result\nimport char\nimport bytearray\n\n// TODO\n// - [ ] handle unicode codepoints (that can span two indices) correctly\n// - [ ] use string buffers or other buffers to implement repeated concatenation more efficiently (and `join`)\n// - [ ] maybe use native implementations for toInt, repeat, split, indexOf, etc.\n\n/**\n * Strings\n * - JS: Strings are represented as UTF-16 code units where some characters take 2 slots (surrogate pairs)\n * - Chez: Strings are sequences of unicode characters (?)\n * - LLVM: UTF-8 (characters can take from 1-4 bytes).\n */\n\n\n// Operations\n// ----------\n\ndef substring(str: String, from: Int, to: Int): String \x3d {\n  def clamp(lower: Int, x: Int, upper: Int) \x3d max(lower, min(x, upper))\n  val lower \x3d clamp(0, from, to)\n  val upper \x3d clamp(0, to, str.length)\n  str.unsafeSubstring(lower, upper)\n}\n\ndef substring(str: String, from: Int): String \x3d\n  str.substring(from, str.length)\n\n\n/// Checks whether str starts with the given prefix at `from`\ndef isSubstringAt(str: String, prefix: String, from: Int): Bool \x3d {\n  with default[OutOfBounds, Bool] { false };\n\n  val stringLength \x3d str.length\n  val prefixLength \x3d prefix.length\n\n  def done?(index: Int): Bool \x3d index \x3e\x3d prefixLength\n  def matches?(index: Int): Bool \x3d prefix.charAt(index) \x3d\x3d str.charAt(index + from)\n\n  def go(index: Int): Bool \x3d\n    if (index.done?) true\n    else if (index.matches?) go(index + 1) else false\n\n  go(0)\n}\n\ndef startsWith(str: String, prefix: String): Bool \x3d\n  isSubstringAt(str, prefix, 0)\n\ndef endsWith(str: String, suffix: String): Bool \x3d\n  isSubstringAt(str, suffix, str.length - suffix.length)\n\n/// Repeats the given string n-times.\n///\n/// TODO use a more efficient way of appending strings like a buffer\ndef repeat(str: String, n: Int): String \x3d {\n  def go(n: Int, result: String): String \x3d {\n    if (n \x3c\x3d 0) result\n    else go(n - 1, result ++ str)\n  }\n  go(n, "")\n}\n\n/// Left-pad the given string with spaces\ndef padLeft(str: String, n: Int): String \x3d {\n  " ".repeat(n - str.length) ++ str\n}\n\n/// Right-pad the given string with spaces\ndef padRight(str: String, n: Int): String \x3d {\n  str ++ " ".repeat(n - str.length)\n}\n\n// TODO use .split() in JS\ndef split(str: String, sep: String): List[String] \x3d {\n  val strLength \x3d str.length\n  val sepLength \x3d sep.length\n\n  // special case: seperator is empty, just emit individual chars\n  def empty(index: Int, components: List[String]): List[String] \x3d\n    if (index \x3e\x3d strLength) components.reverse\n    else empty(index + 1, Cons(str.substring(index, index + 1), components))\n\n  def go(lastIndex: Int, components: List[String]): List[String] \x3d\n    indexOf(str, sep, lastIndex) match {\n      case None() \x3d\x3e\n        Cons(str.substring(lastIndex, strLength), components).reverse\n      case Some(index) \x3d\x3e\n        go(index + sepLength, Cons(str.substring(lastIndex, index), components))\n    }\n\n  if (sepLength \x3d\x3d 0) empty(0, Nil())\n  else go(0, Nil())\n}\n\ndef join(strings: List[String], sep: String): String \x3d {\n  def go(strings: List[String], result: String): String \x3d strings match {\n    case Nil() \x3d\x3e result\n    case Cons(s, rest) \x3d\x3e go(rest, result ++ sep ++ s)\n  }\n  strings match {\n    case Nil() \x3d\x3e ""\n    case Cons(first, rest) \x3d\x3e go(rest, first)\n  }\n}\n\nextern def trim(str: String) at {}: String \x3d\n  js "${str}.trim()"\n\n// Parsing\n// -------\ndef toBool(s: String): Bool / Exception[WrongFormat] \x3d s match {\n  case "true"  \x3d\x3e true\n  case "false" \x3d\x3e false\n  case _ \x3d\x3e wrongFormat("Not a boolean value: \'" ++ s ++ "\'")\n}\n\n// TODO optimize (right now this will be horribly slow (compared to the native JS version)\ndef toInt(str: String): Int / Exception[WrongFormat] \x3d {\n  def go(index: Int, acc: Int): Int \x3d {\n    // wrong index means we\'re done parsing\n    with on[OutOfBounds].default { () \x3d\x3e acc };\n\n    val c \x3d str.charAt(index)\n    val d \x3d char::digitValue(c)\n    go(index + 1, 10 * acc + d)\n  }\n\n  with on[OutOfBounds].default {\n    wrongFormat("Empty string is not a valid number")\n  }\n\n  str.charAt(0) match {\n    case \'-\' \x3d\x3e 0 - go(1, 0)\n    case _   \x3d\x3e go(0, 0)\n  }\n}\n\n// TODO optimize (right now this will be horribly slow (compared to the native JS version)\ndef toInt(str: String, base: Int): Int / Exception[WrongFormat] \x3d {\n  if (base \x3e 36 || base \x3c 1) {\n    wrongFormat("Invalid base: " ++ base.show)\n  }\n\n  def go(index: Int, acc: Int): Int \x3d {\n    // wrong index means we\'re done parsing\n    with on[OutOfBounds].default { () \x3d\x3e acc };\n\n    val c \x3d str.charAt(index)\n    val d \x3d char::digitValue(c, base)\n    go(index + 1, base * acc + d)\n  }\n\n  with on[OutOfBounds].default {\n    wrongFormat("Empty string is not a valid number")\n  }\n\n  str.charAt(0) match {\n    case \'-\' \x3d\x3e 0 - go(1, 0)\n    case _   \x3d\x3e go(0, 0)\n  }\n}\n\n/// Native versions of toInt (unused right now)\nextern def unsafeToInt(str: String) at {}: Int \x3d\n  js "(Number.isNaN(parseInt(${str})) ? undefined : parseInt(${str}))"\n  chez "(string-\x3enumber ${str})"\n\n\n/// Returns the index of the first occurrence of `sub` in `str`\ndef indexOf(str: String, sub: String): Option[Int] \x3d\n  indexOf(str, sub, 0)\n\ndef indexOf(str: String, sub: String, from: Int): Option[Int] \x3d {\n  val len \x3d str.length\n  def go(index: Int): Option[Int] \x3d\n    if (index \x3e\x3d len) None()\n    else if (str.isSubstringAt(sub, index)) Some(index)\n    else go(index + 1)\n\n  go(from)\n}\n\n/// Returns the index of the last occurence of `sub` in `str`\ndef lastIndexOf(str: String, sub: String): Option[Int] \x3d\n  lastIndexOf(str, sub, str.length)\n\ndef lastIndexOf(str: String, sub: String, from: Int): Option[Int] \x3d {\n  def go(index: Int): Option[Int] \x3d\n    if (index \x3c 0) None()\n    else if (str.isSubstringAt(sub, index)) Some(index)\n    else go(index - 1)\n\n  go(from)\n}\n\n// TODO more efficient (native) implementations could be integrated as follows\n\n// extern def indexOf(str: String, sub: String) at {}: Option[Int] \x3d\n//   //js { nativeIndexOf(str, sub) }\n//   default { indexOf(str, sub, 0) }\n\n// def nativeIndexOf(str: String, sub: String): Option[Int] \x3d {\n//   val index \x3d str.unsafeIndexOf(sub)\n//   if (index \x3c 0) { None() } else { Some(index) }\n// }\n\n// extern def unsafeIndexOf(str: String, sub: String) at {}: Int \x3d\n//   js "${str}.indexOf(${sub})"\n\ndef charAt(str: String, index: Int): Char / Exception[OutOfBounds] \x3d\n  if (index \x3c 0 || index \x3e\x3d length(str))\n    do raise(OutOfBounds(), "Index out of bounds: " ++ show(index) ++ " in string: \'" ++ str ++ "\'")\n  else\n    unsafeCharAt(str, index)\n\nextern def unsafeCharAt(str: String, n: Int) at {}: Char \x3d\n  js "${str}.codePointAt(${n})"\n  chez "(char-\x3einteger (string-ref ${str} ${n}))"\n  llvm !!!MULTILINEMARKER!!!\n    %x \x3d call %Int @c_bytearray_character_at(%Pos ${str}, %Int ${n})\n    ret %Int %x\n  !!!MULTILINEMARKER!!!\n  vm "string::unsafeCharAt(String, Int)"\n\n\n// Streaming\n// ---------\n\ndef feed[R](string: String) { reader: () \x3d\x3e R / read[Char] } \x3d\n  feed(string.fromString) {\n    decodeUTF8 {\n      reader()\n    }\n  }\n\ndef each(string: String): Unit / emit[Char] \x3d\n  feed(string) {\n    exhaustively {\n      do emit[Char](do read[Char]())\n    }\n  }\n\ndef collect { stream: () \x3d\x3e Unit / emit[Char] }: String \x3d\n  returning::collect[Unit]{stream}.second\n\nnamespace returning {\n  def collect[R] { stream: () \x3d\x3e R / emit[Char] }: (R, String) \x3d {\n    val (result, bytes) \x3d bytearray::returning::collect[R] { encodeUTF8 { stream } }\n    (result, bytes.toString)\n  }\n}\n');
